import React, { useState, useMemo } from 'react';
import logo from './logo.svg';
import './App.css';

const AnnotherComponent = () => {
  return (
    <p>{Math.random()}</p>
  )
}

const App = () => {

  const [count, setCount] = useState(0)
  const increaseCount = () => {
    setCount(count + 1)
  }

  return (
    <>
      {count}
      <button onClick={increaseCount}>Increase</button>
    </>
  );
}

export default App;
